                style={styles.newCardImage}
              />
              <Text style={styles.newCardNumber}>4.9</Text>
              <Text style={styles.newCardText}>Good</Text>
              <Text style={styles.newCardSubText}>Behaviors</Text>
            </View>
          </View>
          <Text style={{ fontWeight: "700", fontSize: 20, margin: 15 }}>
            Available Time Slots
          </Text>
          {/* Morning Section Card */}
          <View style={styles.morningSectionCard}>

            <View style={styles.timeSlotsContainer}>
              {filteredCook.timings.map((time, index) => (

                <TouchableOpacity

                  key={index}
                  style={[
                    styles.timeSlot,
                    selectedSlot === time && styles.selectedSlot,
                  ]}
                  onPress={() => selectSlot(time)}
                >
                  <Text
                    style={[
                      styles.timeSlotText,
                      selectedSlot === time && styles.selectedSlotText,
                    ]}
                  >
                    {time}
                  </Text>
                </TouchableOpacity>

              ))}
            </View>

          </View>

          {/* Horizontal ScrollView for Cards */}
          <Text style={{ fontWeight: "700", fontSize: 20, margin: 20 }}>
            Reviews
          </Text>
          <ScrollView
            horizontal
            contentContainerStyle={styles.horizontalScrollView}
          >
            {filteredCook.list.map((cookreview, index) => (
              <View key={index}>
                <View style={styles.reviewCard}>
                  <View style={styles.reviewSection}>
                    <View style={styles.reviewContainer}>
                      <Rating
                        type='star'
                        ratingCount={5}
                        imageSize={20}
                        startingValue={cookreview.rating}
                        readonly
                      />
                    </View>
                  </View>
                  <View style={{ marginTop: 10 }}>
                    <Text style={{ fontWeight: "500", color: "#797979" }}>
                      {cookreview.reviews}
                    </Text>
                  </View>
                </View>
              </View>
            ))}
          </ScrollView>
        </View>
        <Modal
          animationType="slide"
          transparent={true}
          visible={modalVisible}
          onRequestClose={() => setModalVisible(false)}
        >
         <View style={styles.modalContainer}>
          <View style={styles.modalContent}>
            <View style={styles.modalColumn}>

              <Text style={styles.modalText}>Review</Text>

            </View>
            <View style={styles.modalRow}>
              <Avatar.Image
                source={{ uri: `http://192.168.29.226:2000${filteredCook.pictures}` }}
                style={[styles.avatarContainer, { marginRight: 10 }]}
              />
              <View style={{ flexDirection: "column" }}>
                <Text style={styles.Name}>{filteredCook.name}</Text>
                <Text style={styles.modalText1}>{filteredCook.phoneNumber}</Text>
                <Text style={styles.modalText3}>{filteredCook.address}</Text>
              </View>
            </View>

            <View style={{ flexDirection: "column", marginTop: 10 }}>

              <Text style={[styles.Slot]}>Selected Timings</Text>
              <Text style={styles.modalSlot}>{selectedSlot}</Text>
            </View>



            <View style={styles.modalButtonContainer}>
              <TouchableOpacity
                style={[styles.modalButton, styles.cancelButton]}
                onPress={() => setModalVisible(false)}
              >
                <Text style={styles.buttonText}>Cancel</Text>
              </TouchableOpacity>
              <TouchableOpacity
                style={[styles.modalButton, styles.continueButton]}
                onPress={handleContinuePress}
              >
                <Text style={styles.buttonText}>Confirm</Text>
              </TouchableOpacity>
            </View>
          </View>
        </View>
        </Modal>
      </ScrollView>
   
    </>
  );
};
